import ham from '../img/ham.jpeg'
const Projects = () => {
  return (
    <div className="projects">
     <div className="container">
       <div className="project-item">
      <figure>
        <img src={ham} alt="" />
        <figcaption>
          Ham's residence
        </figcaption>
      </figure>
       </div>
     </div>
    </div>
  );
};
export default Projects;
